import { useState, useEffect } from "react";
import { motion } from "framer-motion";
import { useNavigate } from "react-router-dom";

export default function Login() {
  const [telefon, setTelefon] = useState("");
  const [adminCode, setAdminCode] = useState("");
  const [error, setError] = useState("");
  const [remember, setRemember] = useState(false);
  const navigate = useNavigate();

  // ðŸ”¹ Adminii care pot accesa sistemul
  const admins = [
    { phone: "076784211", prenume: "Danu" },
    { phone: "060713550", prenume: "Denis" },
  ];

  // ðŸ”’ Codul secret de acces
  const adminAccessCode = "7UVJ5tNnZYni8fQuazbvElFbZcXx9aTTkBaF1v";

  // ðŸ” DacÄƒ e deja logat, redirecÈ›ionÄƒm
  useEffect(() => {
    const savedUser =
      JSON.parse(localStorage.getItem("loggedUser")) ||
      JSON.parse(sessionStorage.getItem("loggedUser"));
    if (savedUser?.isAdmin) {
      navigate("/dashboard");
    }
  }, [navigate]);

  // âœ… VerificÄƒm dacÄƒ este un numÄƒr valid de admin
  const isAdminPhone = admins.some(
    (a) =>
      telefon.replace(/\s|-/g, "") === a.phone ||
      a.phone.endsWith(telefon.replace(/\s|-/g, ""))
  );

  const handleLogin = (e) => {
    e.preventDefault();
    setError("");

    if (!telefon.trim()) {
      setError("Introdu numÄƒrul de telefon!");
      return;
    }

    if (!isAdminPhone) {
      setError("Acest numÄƒr nu are drepturi de administrator!");
      return;
    }

    if (adminCode !== adminAccessCode) {
      setError("Cod de acces greÈ™it!");
      return;
    }

    // âœ… DeterminÄƒm adminul
    const foundAdmin = admins.find(
      (a) =>
        a.phone === telefon.replace(/\s|-/g, "") ||
        a.phone.endsWith(telefon.replace(/\s|-/g, ""))
    );

    const adminUser = {
      id: foundAdmin.phone === "076784211" ? 1 : 2,
      prenume: foundAdmin.prenume,
      nume: "Admin",
      telefon: foundAdmin.phone,
      isAdmin: true,
    };

    // âœ… SalvÄƒm sesiunea
    if (remember)
      localStorage.setItem("loggedUser", JSON.stringify(adminUser));
    else sessionStorage.setItem("loggedUser", JSON.stringify(adminUser));

    window.dispatchEvent(new Event("userUpdated"));
    alert(`ðŸ‘‘ Bun venit, ${foundAdmin.prenume}!`);
    navigate("/dashboard");
  };

  return (
    <section className="min-h-screen flex items-center justify-center bg-[#0f0f0f] text-white">
      <motion.div
        initial={{ opacity: 0, y: 40 }}
        animate={{ opacity: 1, y: 0 }}
        transition={{ duration: 0.6 }}
        className="bg-black/40 backdrop-blur-md border border-[#d4af37]/30 rounded-2xl p-10 w-full max-w-md shadow-lg"
      >
        <h2 className="text-3xl font-bold text-center text-[#d4af37] mb-6">
          Autentificare Admin
        </h2>

        <form onSubmit={handleLogin} className="space-y-6">
          {/* Telefon */}
          <div>
            <label className="block text-sm text-gray-300 mb-2">
              NumÄƒr de telefon
            </label>
            <input
              type="tel"
              value={telefon}
              onChange={(e) => {
                setTelefon(e.target.value);
                setError("");
              }}
              placeholder="076784211 sau 060713550"
              className={`w-full bg-transparent border ${
                error
                  ? "border-red-500 focus:border-red-500"
                  : "border-[#d4af37]/30 focus:border-[#d4af37]"
              } text-white rounded-md px-4 py-2 focus:outline-none transition`}
            />
          </div>

          {/* Cod admin */}
          {isAdminPhone && (
            <motion.div
              initial={{ opacity: 0, y: 10 }}
              animate={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.3 }}
            >
              <label className="block text-sm text-gray-300 mb-2">
                Cod de acces admin
              </label>
              <input
                type="password"
                value={adminCode}
                onChange={(e) => setAdminCode(e.target.value)}
                placeholder="Introdu codul secret"
                className={`w-full bg-transparent border ${
                  error
                    ? "border-red-500 focus:border-red-500"
                    : "border-[#d4af37]/30 focus:border-[#d4af37]"
                } text-white rounded-md px-4 py-2 focus:outline-none transition`}
              />
            </motion.div>
          )}

          {error && (
            <p className="text-red-500 text-xs text-center">{error}</p>
          )}

          {/* Remember me */}
          <div className="flex items-center justify-between text-sm mt-3">
            <label className="flex items-center gap-2 cursor-pointer select-none">
              <input
                type="checkbox"
                checked={remember}
                onChange={() => setRemember(!remember)}
                className="accent-[#d4af37] w-4 h-4"
              />
              <span className="text-gray-300">Èšine-mÄƒ minte</span>
            </label>
          </div>

          {/* Buton Login */}
          <motion.button
            whileHover={{ scale: 1.05 }}
            whileTap={{ scale: 0.95 }}
            type="submit"
            className="w-full mt-5 bg-[#d4af37] text-black font-semibold py-3 rounded-md hover:bg-transparent hover:text-[#d4af37] border border-[#d4af37] transition duration-300"
          >
            AutentificÄƒ-te
          </motion.button>
        </form>

        <p className="text-center text-gray-400 text-xs mt-8">
          Â© 2025 Denis Barbershop. Acces restricÈ›ionat pentru administratori.
        </p>
      </motion.div>
    </section>
  );
}
